require 'test/unit'
require '~/project/Rosalind/Matrix.rb'
require '~/project/Rosalind/DNA.rb'
require 'pp'

class TestDNA < Test::Unit::TestCase
	def test_get_longest_common_substring
		dna_objects = Array.new
		dnas = '                                                                                                   '.split(' ')
		i = 0
		while i < dnas.length
			dna_objects.push(DNA.new(dnas[i]))
			i += 1
		end
		matrix = Matrix.new(dna_objects)
		assert_equal 'GTGGCGTTGTGTAGGGTGACATAACTTCCATTCTGATGATGGCAGAAATGGTCTATCCAGGCATACCAATTTTCGGG', matrix.longest_common_substr
	end
end

